INSERT INTO `programs` VALUES (1,'Vôlei Kids','<p style=\"text-align:justify\">O V&ocirc;lei Kids tem como ferramenta o minivoleibol pois ele estimula e respeita&nbsp;o desenvolvimento motor, f&iacute;sico e biol&oacute;gico, al&eacute;m de ser um jogo adapt&aacute;vel a necessidade e capacidade da crian&ccedil;a, por estimular o dom&iacute;nio de bola sem trazer com isso sobrecarga f&iacute;sica ou mental.&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">Utilizando o esporte como instrumento de ensino, o programa visa a forma&ccedil;&atilde;o do cidad&atilde;o, onde &eacute; dado &ecirc;nfase nas no&ccedil;&otilde;es de responsabilidade, compromisso, disciplina, respeito, educa&ccedil;&atilde;o, higiene, conviv&ecirc;ncia e outros.</p>\r\n\r\n<p style=\"text-align:justify\">Conscientes de que os benef&iacute;cios do esporte v&atilde;o al&eacute;m do entretenimento e lazer, direcionamos a nossa atua&ccedil;&atilde;o com interfaces na educa&ccedil;&atilde;o, cultura e sa&uacute;de, a fim de instruirmos a crian&ccedil;a de forma global e agregarmos valores ao processo educacional, fortalecendo as a&ccedil;&otilde;es escolares e integra&ccedil;&atilde;o familiar.<br />\r\n&nbsp;</p>\r\n','programs/1/59f754e50a602.png',1,NULL,'2017-08-24 19:09:59','2021-06-23 19:43:13'),(2,'Futebol Kids','<p>O Programa FUTEBOL KIDS foi implantado em 2015 considerando os benef&iacute;cios do esporte educacional, visamos agregar valores que possam influenciar as tomadas de decis&otilde;es, estimulando a autonomia e a forma&ccedil;&atilde;o do cidad&atilde;o.</p>\r\n\r\n<p>O futebol tem o m&eacute;rito de por si s&oacute; cativar e impressionar as crian&ccedil;as, e por isso deve ser trabalhado respeitando as individualidades e potencialidades, desconsiderando a empolga&ccedil;&atilde;o que a modalidade proporciona.&nbsp;</p>\r\n\r\n<p>Neste programa, o futebol &eacute; uma ferramenta de atra&ccedil;&atilde;o que manter&aacute; a crian&ccedil;a ass&iacute;dua e interessada, mas o objetivo n&atilde;o ser&aacute; a sua forma&ccedil;&atilde;o como atleta. A crian&ccedil;a precisar&aacute; aprender e conviver com o futebol sendo um esporte de cunho educacional e com ele vivenciar in&uacute;meras situa&ccedil;&otilde;es de aprendizagens, construindo ideias, quebrando paradigmas, e assim incorporar as propostas e valores que ir&atilde;o possibilitar as transforma&ccedil;&otilde;es sociais<br />\r\n&nbsp;</p>\r\n','programs/2/59f75327553ac.png',1,NULL,'2017-08-24 19:10:13','2017-11-23 21:18:18'),(3,'Dó Ré Mi Kids','<p style=\"text-align:justify\">A presen&ccedil;a da m&uacute;sica na vida dos seres humanos &eacute; incontest&aacute;vel. Ela tem acompanhado a hist&oacute;ria da humanidade, ao longo dos tempos, exercendo as mais diferentes fun&ccedil;&otilde;es. Est&aacute; presente em todas as regi&otilde;es, em todas as culturas, em todas as &eacute;pocas: ou seja, a m&uacute;sica &eacute; uma linguagem universal, que ultrapassa as barreiras do tempo e do espa&ccedil;o. (DECKER, 2005).</p>\r\n\r\n<p style=\"text-align:justify\">Nesse sentido, a educa&ccedil;&atilde;o musical proporciona a compreens&atilde;o da m&uacute;sica enquanto produto origin&aacute;rio da hist&oacute;ria, da fus&atilde;o das diversas culturas que se encontram espalhadas pelo mundo, de forma rica e ativa.</p>\r\n\r\n<p style=\"text-align:justify\">A m&uacute;sica, nessa diretriz, necessita estar viva e atuante na escola, seja ela p&uacute;blica ou privada, n&atilde;o somente porque favorece a experi&ecirc;ncia po&eacute;tica e est&eacute;tica, mas tamb&eacute;m porque traduz em si um meio de produ&ccedil;&atilde;o, profissionaliza&ccedil;&atilde;o, trabalho e promo&ccedil;&atilde;o do entendimento intercultural.<br />\r\n&nbsp;</p>\r\n','programs/3/59f75459e469b.png',1,NULL,'2017-08-24 19:10:29','2019-04-10 23:26:00');
/*!40000 ALTER TABLE `programs` ENABLE KEYS */;
